FPTYPE YRerrorEstimator::calculateAlpha(const std::vector<FPTYPE> *boxes, const Calib *cal, bool scaleAlpha)
{
    std::vector<cv::Point3d> pose3d = backprojectYrPose(boxes, ARBIT_Z, *cal);
    FPTYPE torsoLen3D = YRerrorEstimator::torsoLen3D(pose3d);
    FPTYPE calculatedShoulderW = torsoLen3D * SW_TL_RATIO;
    
    
    // project 2 left shoulder and 2 right shoulder points to get shoulder projection rays
    FPTYPE shoulderX, shoulderY;
    // right shoulder:
    boxCenter(boxes->at(4*2 + 0), boxes->at(4*2 + 1), boxes->at(4*2 + 2), boxes->at(4*2 + 3), &shoulderX, &shoulderY);
    cv::Point3d rShoulder3d_1 = YRerrorEstimator::backprojectPoint(cv::Point2d(shoulderX, shoulderY), ARBIT_Z-10, *cal);
    cv::Point3d rShoulder3d_2 = YRerrorEstimator::backprojectPoint(cv::Point2d(shoulderX, shoulderY), ARBIT_Z+10, *cal);
    // left shoulder:
    boxCenter(boxes->at(4*14 + 0), boxes->at(4*14 + 1), boxes->at(4*14 + 2), boxes->at(4*14 + 3), &shoulderX, &shoulderY);
    cv::Point3d lShoulder3d_1 = YRerrorEstimator::backprojectPoint(cv::Point2d(shoulderX, shoulderY), ARBIT_Z-10, *cal);
    cv::Point3d lShoulder3d_2 = YRerrorEstimator::backprojectPoint(cv::Point2d(shoulderX, shoulderY), ARBIT_Z+10, *cal);
    
    // Now working on XZ plane:
    cv::Point2d center = cv::Point2d(pose3d.at(0).x, pose3d.at(0).z); // head is considered the circle center
    // radius is calculatedShoulderW
    std::vector<cv::Point2d> rShoulderIntersections = lineCircleIntersections(rShoulder3d_1.x, rShoulder3d_1.z, rShoulder3d_2.x, rShoulder3d_2.z, center, calculatedShoulderW);
    std::vector<cv::Point2d> lShoulderIntersections = lineCircleIntersections(lShoulder3d_1.x, lShoulder3d_1.z, lShoulder3d_2.x, lShoulder3d_2.z, center, calculatedShoulderW);
    
    
    if (rShoulderIntersections.empty() || lShoulderIntersections.empty()) // something's wrong
        return -1.0;
    if ( (rShoulderIntersections.size() == 1 && lShoulderIntersections.size() == 2) || // the shoulderwidth should be equal to radius
        (rShoulderIntersections.size() == 2 && lShoulderIntersections.size() == 1) )
        return -1.0;
    
    cv::Point2d rightShoulderProjectionXZ, leftShoulderProjectionXZ;
    FPTYPE alpha;
    
    if (rShoulderIntersections.size() == 1 && lShoulderIntersections.size() == 1)
    {
        // exactly parallel to the camera plane
        alpha = 0.0;
    }
    else
    {
        // check actual height of shoulders -- note: BIGGER Y means LOWER:
        // if right shoulder is LOWER than left shoulder
        if (pose3d.at(2).y > pose3d.at(14).y)
        {   // we assume right shoulder is CLOSER
            rightShoulderProjectionXZ = (rShoulderIntersections.at(0).y < rShoulderIntersections.at(1).y) ? rShoulderIntersections.at(0) : rShoulderIntersections.at(1);
            // and left is farther away
            leftShoulderProjectionXZ = (lShoulderIntersections.at(0).y > lShoulderIntersections.at(1).y) ? lShoulderIntersections.at(0) : lShoulderIntersections.at(1);
        }
        else // if right shoulder is HIGHER than left shoulder
        {   // we assume right shoulder is FARTHER
            rightShoulderProjectionXZ = (rShoulderIntersections.at(0).y > rShoulderIntersections.at(1).y) ? rShoulderIntersections.at(0) : rShoulderIntersections.at(1);
            // and left is much closer
            leftShoulderProjectionXZ = (lShoulderIntersections.at(0).y < lShoulderIntersections.at(1).y) ? lShoulderIntersections.at(0) : lShoulderIntersections.at(1);
        }
        
        if (leftShoulderProjectionXZ.x == rightShoulderProjectionXZ.x &&
            leftShoulderProjectionXZ.y == rightShoulderProjectionXZ.y) // exact same points for shoulders
        {
            alpha = PI/2.0; // so we assume right angle
        }
        else
        {
            cv::Vec2d shoulderVect = cv::Vec2d(leftShoulderProjectionXZ.x-rightShoulderProjectionXZ.x, leftShoulderProjectionXZ.y-rightShoulderProjectionXZ.y);
            cv::Vec2d xAxisVect = cv::Vec2d(1.0, 0.0);
            // this gives the angle measured from v1 around to v2 with the
            // understanding that a counterclockwise direction is positive and
            // a clockwise direction is negative. Its range is then from -pi to +pi.
            // append vectors side by side to get 2x2 mat
            cv::Mat squareMat = (cv::Mat_<FPTYPE>(2,2) << shoulderVect[0], xAxisVect[0], shoulderVect[1], xAxisVect[1]);
            
            alpha = std::atan2(std::fabs(cv::determinant(squareMat)), shoulderVect.dot(xAxisVect)); // fabs: float absolute
            
            //  Scale alpha:  alpha should be [0, pi/2]
            if (alpha > PI/2.0 && scaleAlpha)
                alpha = PI - alpha;
        }
    }
    
    return alpha;
}


// dirSpineVector is the directional vector, pointing upwards
void YRerrorEstimator::bodyCenterAndTorsoLen2D(const std::vector<FPTYPE> *boxes, /*OUTPUT*/ cv::Point2d *bodyCenter, cv::Vec2d *dirSpineVector, FPTYPE *torsoLen)
{
    FPTYPE tempX, tempY;
    boxCenter(boxes->at(4*2 + 0), boxes->at(4*2 + 1), boxes->at(4*2 + 2), boxes->at(4*2 + 3),
              &tempX, &tempY);
    cv::Point2d upperRight = cv::Point2d(tempX, tempY);
    boxCenter(boxes->at(4*14 + 0), boxes->at(4*14 + 1), boxes->at(4*14 + 2), boxes->at(4*14 + 3),
              &tempX, &tempY);
    cv::Point2d upperLeft = cv::Point2d(tempX, tempY);
    boxCenter(boxes->at(4*9 + 0), boxes->at(4*9 + 1), boxes->at(4*9 + 2), boxes->at(4*9 + 3),
              &tempX, &tempY);
    cv::Point2d lowerRight = cv::Point2d(tempX, tempY);
    boxCenter(boxes->at(4*21 + 0), boxes->at(4*21 + 1), boxes->at(4*21 + 2), boxes->at(4*21 + 3),
              &tempX, &tempY);
    cv::Point2d lowerLeft = cv::Point2d(tempX, tempY);
    
    cv::Point2d upperCenter = (upperLeft + upperRight) * 0.5;
    cv::Point2d lowerCenter = (lowerLeft + lowerRight) * 0.5;
    
    *torsoLen = std::sqrt(std::pow(upperCenter.x - lowerCenter.x, 2) + std::pow(upperCenter.y - lowerCenter.y, 2));
    
    *bodyCenter = (upperCenter + lowerCenter) * 0.5;
    
    if (dirSpineVector)
    {
        *dirSpineVector = (cv::Vec2d)(upperCenter - lowerCenter);
    }
}

FPTYPE YRerrorEstimator::torsoLen3D(std::vector<cv::Point3d> pose3d)
{
    cv::Point3d upperRight = pose3d.at(3-1);
    cv::Point3d upperLeft = pose3d.at(15-1);
    cv::Point3d lowerRight = pose3d.at(10-1);
    cv::Point3d lowerLeft = pose3d.at(22-1);
    
    cv::Point3d upperCenter = (upperLeft + upperRight) * 0.5;
    cv::Point3d lowerCenter = (lowerLeft + lowerRight) * 0.5;
    
    return std::sqrt(std::pow(upperCenter.x - lowerCenter.x, 2) + std::pow(upperCenter.y - lowerCenter.y, 2) + std::pow(upperCenter.z - lowerCenter.z, 2));
}

cv::Point3d YRerrorEstimator::backprojectPoint(cv::Point2d pt, FPTYPE z, Calib cal)
{
    // Pixel coordinates to camera frame coordinates :
    FPTYPE xx_pixel = pt.x;
    FPTYPE yy_pixel = pt.y;
    
    FPTYPE xx = (xx_pixel - cal.cX) / cal.fcX;
    FPTYPE yy = (yy_pixel - cal.cY) / cal.fcY;
    
    FPTYPE x = xx * z;
    FPTYPE y = yy * z;
    
    cv::Point3d pt3d = cv::Point3d(x,y,z);
    
    return pt3d;
}

std::vector<cv::Point3d> YRerrorEstimator::backprojectYrPose(const std::vector<FPTYPE> *boxes, FPTYPE z, Calib cal)
{
    std::vector<cv::Point3d> pose3d;
    
    int nbParts = (int)((boxes->size()-2)/4);
    
    for (int p=0; p<nbParts; p++)
    {
        FPTYPE X2d, Y2d;
        boxCenter(boxes->at(4*p + 0), boxes->at(4*p + 1), boxes->at(4*p + 2), boxes->at(4*p + 3),
                  &X2d, &Y2d);
        
        cv::Point3d p3d = YRerrorEstimator::backprojectPoint(cv::Point2d(X2d,Y2d), z, cal);
        pose3d.push_back(p3d);
    }
    
    return pose3d;
}

std::vector<cv::Point2d> YRerrorEstimator::lineCircleIntersections(FPTYPE x1, FPTYPE y1, FPTYPE x2, FPTYPE y2, cv::Point2d center, FPTYPE radius)
{
    std::vector<cv::Point2d> intersectPts;
    
    // calculate m and b in y = mx + b
    FPTYPE m = (y2-y1) / (x2-x1);
    FPTYPE b = y1 - m*x1;
    
    // circle eq:
    //      (x−p)^2 + (y−q)^2 = r^2. (p = center.x, q = center.y)
    // replace y with mx + b :
    //      (x−p)^2 + (mx+b−q)^2 = r^2. (p = center.x, q = center.y)
    // expand & re-organize:
    //      (m^2 + 1)x^2 + 2(mb − mq − p)x + (q^2 − r^2 + p^2 − 2bq + b^2) = 0
    // replace the factors to get Ax^2 + Bx + C = 0
    FPTYPE A = m*m + 1;
    FPTYPE B = 2*(m*b - m*center.y - center.x);
    FPTYPE C = center.y*center.y - radius*radius + center.x*center.x + b*b;
    
    FPTYPE discriminant = B*B - 4.0*A*C;
    
    //    if (discriminant < 0.0) {} // no intersection
    if (discriminant == 0.0) // intersection on single point
    {
        FPTYPE xInt = -B / (2.0 * A);
        FPTYPE yInt = m * xInt + b;
        
        intersectPts.push_back(cv::Point2d(xInt, yInt));
    }
    else if (discriminant > 0.0) //  intersection on two points
    {
        // first point
        FPTYPE xInt = (-B + std::sqrt(discriminant)) / (2.0 * A);
        FPTYPE yInt = m * xInt + b;
        intersectPts.push_back(cv::Point2d(xInt, yInt)),
        // second point
        xInt = (-B - std::sqrt(discriminant)) / (2.0 * A);
        yInt = m * xInt + b;
        intersectPts.push_back(cv::Point2d(xInt, yInt));
    }
    
    return intersectPts;
}

// calculates part angles for each limb part, from 2D pose
void YRerrorEstimator::partAnglesAndNormalizedDists2D(const std::vector<FPTYPE> *boxes, /*OUTPUT*/ std::vector<FPTYPE> *betas, std::vector<FPTYPE> *dists)
{
    // orginal part numbers and row indices in betasAndDists are in follows:
    //    int idx[] = {4-1, 5-1, 6-1, 7-1, 11-1, 12-1, 13-1, 14-1, 16-1, 17-1, 18-1, 19-1, 23-1, 24-1, 25-1, 26-1};
    //    int numel = 16;
    int idx[] = {1-1, 2-1, 3-1, 4-1, 5-1, 6-1, 7-1, 8-1,9-1,10-1,11-1, 12-1, 13-1, 14-1, 15-1,16-1, 17-1, 18-1, 19-1, 20-1,21-1,22-1, 23-1, 24-1, 25-1, 26-1};
    int numel = 26;
    
    
    // miSp is considered the body center, directional vector for the spine
    cv::Point2d bodyCenter = cv::Point2d(0.0,0.0);
    cv::Vec2d dirSpineVector = cv::Vec2d(0.0,0.0);
    FPTYPE torsoLen = 0.0;
    YRerrorEstimator::bodyCenterAndTorsoLen2D(boxes, &bodyCenter, &dirSpineVector, &torsoLen);
    
    if (torsoLen == 0.0)
        return;
    
    for (int p=0; p<numel; p++)
    {
        // x, y vectors
        FPTYPE partX, partY;
        boxCenter(boxes->at(4*idx[p] + 0), boxes->at(4*idx[p] + 1), boxes->at(4*idx[p] + 2), boxes->at(4*idx[p] + 3),
                  &partX, &partY);
        
        // directional vector for the joint-midSpine line
        // HACK : instead of zero, we got ~1e-14 difference, which results in -PI instead of PI
        FPTYPE dX = partX-bodyCenter.x;
        if ( (dX > 0 &&  dX < 1.0e-12) || // close to 0+
            (dX < 0 &&  dX > -1.0e-12) )  // close to 0-
            dX = 0.0;
        cv::Vec2d dirJoint = cv::Vec2d(dX, partY-bodyCenter.y);
        
        // this gives the angle measured from v1 around to v2 with the
        // understanding that a counterclockwise direction is positive and
        // a clockwise direction is negative. Its range is then from -pi to +pi.
        FPTYPE beta;
        FPTYPE dist;
        // append vectors side by side to get 2x2 mat
        cv::Mat squareMat = (cv::Mat_<FPTYPE>(2,2) << dirSpineVector[0], dirJoint[0], dirSpineVector[1], dirJoint[1]);
        
        beta = std::atan2(cv::determinant(squareMat), dirSpineVector.dot(dirJoint));
        betas->push_back(beta);
        
        dist = sqrt((partX-bodyCenter.x)*(partX-bodyCenter.x) + (partY-bodyCenter.y)*(partY-bodyCenter.y));
        // normalize by TorsoLen and push
        dists->push_back(dist/torsoLen);
    }
}

// NN MODULE FUNCTIONS
// Map Minimum and Maximum Input Processing Function
cv::Mat YRerrorEstimator::mapminmax_apply(cv::Mat x, cv::Mat settings_gain, cv::Mat settings_xoffset, FPTYPE settings_ymin)
{
    cv::Mat y = cv::Mat::zeros(x.rows, x.cols, x.type());
    y = x - settings_xoffset;
    y = y.mul(settings_gain); // elementwise multiplication
    y = y + settings_ymin;
    return y;
}

// Sigmoid Symmetric Transfer Function
cv::Mat YRerrorEstimator::tansig_apply(cv::Mat n)
{
    cv::Mat a = cv::Mat::zeros(n.rows, n.cols, n.type());
    cv::Mat minus2nExp = cv::Mat::zeros(n.rows, n.cols, n.type());
    //a = 2 / (1 + exp(-2*n)) - 1,
    cv::exp(-2.0*n, minus2nExp);
    a = (2.0 / (1.0 + minus2nExp) ) - 1;
    return a;
}

// Map Minimum and Maximum Output Reverse-Processing Function
std::vector<FPTYPE> YRerrorEstimator::mapminmax_reverse_vect(cv::Mat y, cv::Mat settings_gain, cv::Mat settings_xoffset, FPTYPE settings_ymin)
{
    cv::Mat x = cv::Mat::zeros(y.rows, y.cols, y.type());
    x = y - settings_ymin;
    x = x / settings_gain;
    x = x + settings_xoffset;
    std::vector<FPTYPE> xVect;
    cv::MatIterator_<FPTYPE> it, end;
    for( it = x.begin<FPTYPE>(), end = x.end<FPTYPE>(); it != end; ++it)
        xVect.push_back(*it);
    return xVect;
}

// Map Minimum and Maximum Output Reverse-Processing Function
FPTYPE YRerrorEstimator::mapminmax_reverse(FPTYPE y, FPTYPE settings_gain, FPTYPE settings_xoffset, FPTYPE settings_ymin)
{
    FPTYPE x = 0.0;
    x = y - settings_ymin;
    x = x / settings_gain;
    x = x + settings_xoffset;
    return x;
}


